  [],\n\t\"revision_timestamp\": \"2015-01-22T15:57:36.373929\",\n\t\"name\": \"fair-market-rents\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset and map service provides information
  on Fair Market Rents (FMRs). FMRs are primarily used to determine payment standard
  amounts for the Housing Choice Voucher program, initial renewal rents for some expiring
  project-based Section 8 contracts, initial rents for housing assistance payment
  (HAP) contracts in the Moderate Rehabilitation Single Room Occupancy program (Mod
  Rehab), and to serve as a rent ceiling in the HOME Investment Partnership Program
  (HOME) for rental assistance. HUD annually estimates FMRs for 530 metropolitan areas
  and 2,045 nonmetropolitan county FMR areas. By law the final FMRs for use in any
  Fiscal Year must be published and available for use at the start of that Fiscal
  Year, on October 1.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
